DROP TABLE IF EXISTS `tb_wechat_app`;
CREATE TABLE `tb_wechat_app`  (
  `id` bigint(20) NOT NULL COMMENT '主键ID',
  `company_id` bigint(20) NULL DEFAULT NULL COMMENT '企业ID',
  `company_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '企业名称',
  `app_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '小程序名称',
  `authorizer_appid` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '授权信息-授权方appid',
  `authorizer_access_token` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '授权信息-授权方接口调用凭据',
  `authorizer_expires` int(11) UNSIGNED NULL DEFAULT NULL COMMENT '授权信息-令牌有效期 默认2小时',
  `authorizer_refresh_token` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '授权信息-接口调用凭据刷新令牌',
  `func_info` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '授权信息-授权给开发者的权限集列表 json格式',
  `authorize_time` datetime(0) NULL DEFAULT NULL COMMENT '授权时间',
  `authorize_status` tinyint(1) NULL DEFAULT NULL COMMENT '授权状态(1：已授权 2:取消授权)',
  `nick_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '授权方昵称',
  `head_img` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '授权方头像',
  `service_type_info` tinyint(1) NULL DEFAULT NULL COMMENT '授权方公众号类型，0代表订阅号，1代表由历史老帐号升级后的订阅号，2代表服务号',
  `verify_type_info` tinyint(1) NULL DEFAULT NULL COMMENT '授权方认证类型，-1代表未认证，0代表微信认证，1代表新浪微博认证，2代表腾讯微博认证，3代表已资质认证通过但还未通过名称认证，4代表已资质认证通过、还未通过名称认证，但通过了新浪微博认证，5代表已资质认证通过、还未通过名称认证，但通过了腾讯微博认证',
  `user_name` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '授权方公众号的原始ID',
  `principal_name` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '公众号的主体名称',
  `alias` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '授权方公众号所设置的微信号',
  `business_info` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '用以了解以下功能的开通状况（0代表未开通，1代表已开通）： open_store:是否开通微信门店功能 open_scan:是否开通微信扫商品功能 open_pay:是否开通微信支付功能 open_card:是否开通微信卡券功能 open_shake:是否开通微信摇一摇功能 json格式',
  `qrcode_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '二维码图片的URL',
  `signature` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '帐号介绍',
  `mini_program_info` varchar(1000) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '可根据这个字段判断是否为小程序类型授权',
  `code_commit_time` datetime(0) NULL DEFAULT NULL COMMENT '上传小程序代码时间',
  `template_id` bigint(20) NULL DEFAULT NULL COMMENT '代码模板ID',
  `ext_json` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '第三方自定义的配置',
  `user_version` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '代码版本号',
  `user_desc` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '代码描述',
  `category_list` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '可填选的类目列表',
  `page_list` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '页面配置列表',
  `submit_audit_time` datetime(0) NULL DEFAULT NULL COMMENT '代码包提交审核时间',
  `item_list` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '提交审核项列表',
  `audit_id` bigint(20) NULL DEFAULT NULL COMMENT '审核编号',
  `audit_status` tinyint(1) NULL DEFAULT NULL COMMENT '审核状态，其中0为审核成功，1为审核失败，2为审核中，3已撤回',
  `audit_fail_time` datetime(0) NULL DEFAULT NULL COMMENT '审核失败时间',
  `audit_succ_time` datetime(0) NULL DEFAULT NULL COMMENT '审核成功时间',
  `audit_reason` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '审核被拒绝时，返回的拒绝原因',
  `release_time` datetime(0) NULL DEFAULT NULL COMMENT '发布时间',
  `release_status` tinyint(4) NULL DEFAULT NULL COMMENT '发布状态，其中1为成功，2失败',
  `release_reason` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '发布失败原因',
  `tabbar_id` bigint(20) NULL DEFAULT NULL COMMENT '底部栏目ID',
  `status` tinyint(1) NOT NULL DEFAULT 1 COMMENT '状态(0:禁用,1:正常)',
  `create_time` datetime(0) NOT NULL COMMENT '创建时间',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '修改时间',
  `create_user` bigint(20) NULL DEFAULT NULL COMMENT '创建人ID',
  `update_user` bigint(20) NULL DEFAULT NULL COMMENT '修改人ID',
  `deleted` tinyint(1) NOT NULL DEFAULT 0 COMMENT '删除状态（0：未删除，1：已删除）',
  `description` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '描述',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci COMMENT = '小程序信息表' ROW_FORMAT = Dynamic;


