INSERT INTO `tb_decision_library` VALUES (1, '2021-10-28 16:46:26', '2021-10-28 16:46:27', -1, 1, b'0', '综合概况', NULL, NULL, NULL, NULL, NULL, '截止 ${YEAR_MONTH_STATISTICAL}，${YEAR_MONTH_STATISTICAL}${PLATFORM_NAME}共检测出 ${RISK_WARNING_ITEMS_NUMBER} 项风险预警。\n从风险级别来看，高风险项 ${HIGH_RISK_WARNING_ITEMS_NUMBER} 项，中风险项 ${MIDDLE_RISK_WARNING_ITEMS_NUMBER} 项，低风险项 ${LOW_RISK_WARNING_ITEMS_NUMBER} 项。\n需要重点关注${HIGH_RISK_WARNING_ITEMS_TARGET}中的变化情况。${YEAR_MONTH_STATISTICAL}${YEAR_MONTH_STATISTICAL}${PLATFORM_NAME}${YEAR_MONTH_STATISTICAL}${YEAR_MONTH_STATISTICAL}${YEAR_MONTH_STATISTICAL}', 1, 3, '风险预警项数量');
INSERT INTO `tb_decision_library` VALUES (2, '2021-10-28 16:32:20', NULL, 1, NULL, b'0', '省外游客', 0, 1.0000, 1.0000, 1.0000, NULL, '${YEAR_MONTH_STATISTICAL},${PLATFORM_SIMPLE_NAME}共接待游客${PROVINCE_OUTSIDE_TOUR_NUM}人次，较上月环比${HB}，较去年同年同月相比${TB}。建议针对省外游客规划特色旅游路线，吸引省外游客前往', 1, 12, '省外游客数量');
INSERT INTO `tb_decision_library` VALUES (3, '2021-08-20 18:35:47', '2021-08-20 18:35:47', 1, 1, b'0', '省内游客', 0, 0.1000, 0.2000, 0.3000, 0, '第三方${PROVINCE_INSIDE_TOUR_NUM}', 1, 17, '省内游客数量');
INSERT INTO `tb_decision_library` VALUES (4, '2021-08-20 18:36:47', '2021-08-20 18:36:47', -1, 1, b'0', '整体游客', 0, 0.1000, 0.2000, 0.3000, 1, '${YEAR_MONTH_STATISTICAL} ，${PLATFORM_SIMPLE_NAME} 共接待游客 ${PROVINCE_ALL_TOUR_NUM} 人次。\r\n较上月环比 ${HB} ，较去年同月同比${TB} 。\r\n建议加强旅游吸引物的宣传推广力度吸引更多游客前往', 1, 22, '整体游客数量');
INSERT INTO `tb_decision_library` VALUES (5, '2021-08-20 18:36:46', '2021-08-20 18:36:46', -1, 1, b'0', '整体景区客流', 0, 0.1000, 0.2000, 0.3000, 1, '${YEAR_MONTH_STATISTICAL}，${PLATFORM_SIMPLE_NAME}全部景区共接待游客${ALL_SCENIC_SPOTS_RECEPTIONS_NUMBER}人次。\r\n较上月环比${HB}，较去年同月同比${TB}。\r\n建议加强景区建设及宣传吸引更多客流。', 1, 27, '全部景区接待数量');
INSERT INTO `tb_decision_library` VALUES (6, '2021-08-20 18:35:19', '2021-08-20 18:35:19', -1, 1, b'0', '景区客流排行', 0, NULL, NULL, NULL, 1, '${YEAR_MONTH_STATISTICAL}，${SCENIC_SPOT_MOST_TOURISTS_LOST_NAME}共接待游客${TOURISTS_LARGEST_LOSS_SCENIC_RECEPTION_VOLUME}人次。\r\n较上月环比${HB}，较去年同月同比${TB}，是所有景区中月环比下降最多的景区。\r\n除此之外，${SCENIC_SPOT_MOST_OTHER_TOURISTS_LOST_NAME}客流也有相应程度的下降。\r\n建议加强对以上景区的建设及宣传吸引更多客流。', 0, 31, '游客流失最多景区名称');
INSERT INTO `tb_decision_library` VALUES (7, '2021-08-20 18:36:45', '2021-08-20 18:36:45', -1, 1, b'0', '整体景区满意度', 0, 0.1000, 0.2000, 0.3000, 1, '${YEAR_MONTH_STATISTICAL}，整体景区共收到${ALL_SCENIC_SPOT_EVALUATIONS_NUMBER}条评价，其中好评数量为${ALL_SCENIC_SPOT_POSITIVE_EVALUATIONS_NUMBER}条，满意度为${OVERALL_SCENIC_SPOT_SATISFACTION}。\r\n较上月满意度环比${HB}，较去年同月同比${TB}。\r\n建议加强对景区的服务质量管理，以提高游客满意度。', 1, 37, '整体景区评价数量');
INSERT INTO `tb_decision_library` VALUES (8, '2021-08-20 18:36:44', '2021-08-20 18:36:44', -1, 1, b'0', '景区满意度排行', 0, 0.1000, 0.2000, 0.3000, 1, '${YEAR_MONTH_STATISTICAL}，${SATISFACTION_MOST_DECLINE_SCENIC_SPOT_NAME}共收到${SATISFACTION_MOST_DECLINE_SCENIC_SPOT_EVALUATION}条评价，其中好评数量为${SATISFACTION_MOST_DECLINE_SCENIC_SPOT_GOOD_EVALUATION}条，满意度为${SATISFACTION_MOST_DECLINE_SCENIC_SPOT_SATISFACTION}。\r\n较上月满意度环比${HB}，较去年同月同比${TB}，是所有景区中月环比下降最多的景区。\r\n除此之外，${OTHER_SATISFACTION_MOST_DECLINE_SCENIC_SPOT_NAME}满意度也有相应程度的下降。\r\n建议加强对以上景区的服务质量管理，以提高游客满意度。', 1, 44, '满意度下降最多景区评价量');
INSERT INTO `tb_decision_library` VALUES (9, '2021-08-20 18:36:43', '2021-08-20 18:36:43', -1, 1, b'0', '整体酒店民宿满意度', 0, 0.1000, 0.2000, 0.3000, 0, '${YEAR_MONTH_STATISTICAL}，整体酒店民宿共收到${OVERALL_HOTEL_AND_HOMESTAY_REVIEWS_NUMBER}条评价，其中好评数量为${OVERALL_HOTEL_AND_HOMESTAY_GOOD_REVIEWS_NUMBER}条，满意度为${OVERALL_HOTEL_AND_HOMESTAY_SATISFACTION}。\r\n较上月满意度环比${HB}，较去年同月同比${TB}。\r\n建议加强对酒店民宿的服务质量管理，以提高游客满意度。', 1, 51, '整体酒店民宿评价数量');
INSERT INTO `tb_decision_library` VALUES (10, '2021-08-21 11:27:24', '2021-08-21 11:27:24', -1, 1, b'0', '酒店民宿满意度排行', 0, NULL, NULL, NULL, 1, '${YEAR_MONTH_STATISTICAL}，${MOST_SATISFACTION_DECLINE_HOTEL_AND_HOMESTAY_NAME}共收到${MOST_SATISFACTION_DECLINE_HOTEL_AND_HOMESTAY_EVALUATION}条评价，其中好评数量为${MOST_SATISFACTION_DECLINE_HOTEL_AND_HOMESTAY_GOOD_EVALUATION}条，满意度为${MOST_SATISFACTION_DECLINE_HOTEL_AND_HOMESTAY_SATISFACTION}。\r\n较上月满意度环比${HB}，较去年同月同比${TB}，是所有酒店民宿中月环比下降最多的。\r\n除此之外，${OTHER_SATISFACTION_DECLINE_HOTEL_AND_HOMESTAY_NAME}满意度也有相应程度的下降。\r\n建议加强对以上酒店民宿的服务质量管理，以提高游客满意度。', 0, 57, '满意度下降最多酒店民宿名称');
INSERT INTO `tb_decision_library` VALUES (11, '2021-08-20 18:36:08', '2021-08-20 18:36:08', -1, 1, b'0', '投诉量', 0, 0.1000, 0.2000, 0.3000, 0, '${YEAR_MONTH_STATISTICAL}，一码游共产生订单${ONE_TRAVEL_COMPLAINTS_NUMBER}单。\r\n较上月环比${HB}，较去年同月同比${TB}。\r\n建议增加产品多样性或进行优惠促销提升交易量。', 1, 65, '一码游投诉数量');
INSERT INTO `tb_decision_library` VALUES (12, '2021-08-20 18:36:17', '2021-08-20 18:36:17', -1, 1, b'0', '订单量', 0, 0.1000, 0.2000, 0.3000, 1, '${YEAR_MONTH_STATISTICAL}，一码游共产生订单${ONE_TRAVEL_ORDER_NUMBER}单。\r\n较上月环比${HB}，较去年同月同比${TB}。\r\n建议增加产品多样性或进行优惠促销提升交易量。', 1, 69, '一码游订单数量');
INSERT INTO `tb_decision_library` VALUES (13, '2021-08-20 18:36:54', '2021-08-20 18:36:54', -1, 1, b'0', '交易额', 0, 0.1000, 0.2000, 0.3000, 3, '${YEAR_MONTH_STATISTICAL}，一码游共产生交易额${ONE_TRAVEL_TRANSACTION_AMOUNT}元。\r\n较上月环比${HB}，较去年同月同比${TB}。\r\n建议增加产品多样性或进行优惠促销提升交易额。', 1, 73, '一码游交易额');
INSERT INTO `tb_decision_library` VALUES (14, '2021-08-20 18:36:55', '2021-08-20 18:36:55', -1, 1, b'0', '旅游投诉', 0, 0.1000, 0.2000, 0.3000, 2, '${YEAR_MONTH_STATISTICAL}，共收到投诉${TRAVEL_COMPLAINTS_NUMBER}条。\r\n较上月环比${HB}，较去年同月同比${TB}。\r\n建议及时处理反馈游客投诉并提升服务质量', 1, 77, '旅游投诉数量');
INSERT INTO `tb_decision_library` VALUES (15, '2021-08-20 18:36:56', '2021-08-20 18:36:56', -1, 1, b'0', '应急事件统计', 0, 0.1000, 0.2000, 0.3000, 1, '${YEAR_MONTH_STATISTICAL}，共发生应急事件${EMERGENCIES_NUMBER}起。\r\n较上月环比${HB}，较去年同月同比${TB}。\r\n建议有效应急预案及应急事件防御机制以降低出现应急事件的可能性。', 1, 81, '应急事件数量');
INSERT INTO `tb_decision_library` VALUES (16, '2021-08-21 12:32:06', '2021-08-21 12:32:06', -1, 1, b'0', '高发应急事件', 0, 0.1000, 0.2000, 0.3000, 0, '${YEAR_MONTH_STATISTICAL}，共发生应急事件${HIGH_INCIDENCE_EMERGENCIES_NUMBER}起，其中高发事件类型为${HIGH_INCIDENCE_EMERGENCIES_TYPE}，高发事件等级为${HIGH_INCIDENCE_EVENT_GRADE}。\r\n${HIGH_INCIDENCE_EMERGENCIES_TYPE}类事件较上月数量环比${HIGH_INCIDENCE_EMERGENCIES_TYPE_HB}，较去年同月同比${HIGH_INCIDENCE_EMERGENCIES_TYPE_TB}。${HIGH_INCIDENCE_EVENT_GRADE}事件较上月数量环比${HIGH_INCIDENCE_EVENT_GRADE_HB}，较去年同月同比${HIGH_INCIDENCE_EVENT_GRADE_TB}。\r\n建议针对不同类型和等级事件做好应急预案及应急演练，防范应急事件的高频发生', 1, 86, '高发事件类型');
